import './styles.css';
import { useState, useEffect } from 'react';

import GameOutput from './boxoutput.js'



function App() {


  const [circle1, setCircle1] = useState(['circle-grey',''])
  const [circle2, setCircle2] = useState(['circle-grey',''])
  const [circle3, setCircle3] = useState(['circle-grey',''])
  const [circle4, setCircle4] = useState(['circle-grey',''])


  const [turnCount, setTurnCount] = useState(0);
  //const [difficulty, setDifficulty] = useState('');
  const [gameStatus, setGameStatus] = useState('');
  const [code, setCode] =useState([]);


  //Code Geneting
  const codeRef = ['YLW', 'BLU', 'BRN', 'GRN', 'RED', 'VLT']


  const generateCode= () => {

    let res =[]

    for(let i = 0; i < 4 ; i++) {
      res.push(codeRef[Math.floor(Math.random() * codeRef.length)])
    }
    console.log(res)
    setCode(res);

  }


  //Gamee Logic
  function codeTest(arr) {

    let ref

    arr = arr.map((el, i) => {if (el === code[i]) {return 'X' } else return el}) ;


    // make these win and lose conditions generate a modal 
    if (arr.join('') === 'XXXX') return 'CODEBREAK!';

    if (turnCount === 10) return 'LOSER';
    //

    setTurnCount(prevCount => prevCount + 1);

    ref = code.map((el, i) => { if (arr[i] === 'X') { return 'X'} else return el});

    arr = arr.map((el, i) => {
        if (el === 'X') return el;
        if (ref.includes(el)) return 'O';
        return 'F';
        });

    return arr.sort().reverse().join('');

  }
  //




  return (
    <div className="App">
      <div className="header">

        <p className="mastermind-logo">MASTERMIND</p>

      </div>

      <div className="backdrop">
        <span className='top'></span>
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <GameOutput />
        <span className='bot'></span>

        <div className="game-controls">
          <div className='controls1'>
            <span className={`circle-input ${circle1}`}></span>
            <span className={`circle-input ${circle2}`}></span>
            <span className={`circle-input ${circle3}`}></span>
            <span className={`circle-input ${circle4}`}></span>
            <button className='buttoncheck'> CHECK </button>
          </div>
          <div className='controls2'>
            <span  draggable="true" className='circle-input circle-red'></span>
            <span  draggable="true" className='circle-input circle-blue'></span>
            <span  draggable="true" className='circle-input circle-yellow'></span>
            <span  draggable="true" className='circle-input circle-brown'></span>
            <span  draggable="true" className='circle-input circle-orange'></span>
            <span  draggable="true" className='circle-input circle-green '></span>
            <span  draggable="true" className='circle-input circle-white'></span>
            <span  draggable="true" className='circle-input circle-black'></span>          
          </div>

        </div>
      </div>

      <div className="footer"></div>
    </div>
  );
}

export default App;
